window.bookSummaryJSON = "<p>Devon Sanders, a private investigator known for his efficiency and discretion, has no interest in getting involved with the paranormal community. Unfortunately for him, the paranormal community does have an interest in him, or at least in his secret. </p> <p><b>Dark Waters (Book 1)</b> </p> <p>When Devon uncovers a violent murder, he knows it is not a natural crime. In order to solve this case and expose the murderer, he will have to go undercover as a wizard in the paranormal university, Quintessence. He soon discovers that his talent has more to do with supernatural forces than he ever knew. </p> <p><b>Hungry Earth (Book 2)</b> </p> <p>When a student dies of no apparent cause, the search for a witness leads Devon to discover there are more secrets buried under Quintessence than he ever realized. In order to save the paranormal world he is now part of, he will face an enemy that can use his own power against him. Devon must rely on more than his exceptional intuition to solve this case. </p> <p>Magic is elemental. </p>"; 
